import './App.css';
import styled from 'styled-components';
function App() {
  return (
    <Container>
      <Content>
      <h1>What's the plan for Today</h1>
      < InputContent>
      <input/>
      <button>Add Todo</button>
      </InputContent>
      </Content>
    </Container>
  );
}

export default App;


const Container =styled.div`
width:100vw;
height:100vh;
display:flex;
justify-content:start;
flex-direction:column;
background: linear-gradient( 90deg,rgba(48, 16, 255, 1) 0%,rgba(100, 115, 255, 1) 100%);




`


const Content =styled.div`
width: 520px;
margin: 128px auto;
border-radius: 10px;
padding-bottom: 32px;

min-height: 600px;
height:auto;
background: #161a2b;
text-align:center;
box-sizing:border-box;
color:#ffff;
display:flex;
align-items:center;
flex-direction:column;


`

const InputContent=styled.div`
display:flex;
border:4px solid rgb(75, 3, 148);
width:70%;
height:30px;

input{
  border:none;
  flex:1;
  background-color:transparent;
}
button{
  padding: 16px;
  border: none;
  border-radius: 0 4px 4px 0;
  cursor: pointer;
  outline: none;
  background: linear-gradient(
    90deg,
    rgba(93, 12, 255, 1) 0%,
    rgba(155, 0, 250, 1) 100%
  );
  color: #fff;
  text-transform: capitalize;

  }

`
